import React from "react";
// import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import InstagramIcon from '@material-ui/icons/Instagram';
import TwitterIcon from '@material-ui/icons/Twitter';
import YouTubeIcon from '@material-ui/icons/YouTube';

const Footer = () => {

return(
    <>
        <footer className="w-100 bg-light text-center p-5">
            <p> &#x00A9; 2020 Department Of CSE. All Rights Reserved | Terms and Condition Apply </p>
            <div className="social_media d-flex justify-content-center">          
          <a href="https://www.facebook.com/BITSindriDhanbad"> <FacebookIcon className="icon_f" /> </a>
          <a href="https://www.linkedin.com/school/bit-sindri/"> <LinkedInIcon className="icon_l" /> </a>
          <a href="#" className="disabled"> <InstagramIcon className="icon_i" /> </a>
          <a href="https://twitter.com/BITSindriDhn"> <TwitterIcon className="icon_t" /> </a>
          <a href="https://www.youtube.com/channel/UCiGskazB1Ihtzzx6kdseLFg"> <YouTubeIcon className="icon_y" /> </a>
          </div>
        </footer>
    </>
);
};
export default Footer;
